		_SetCameraAngle(e) {
			if (!this.threeJsContext || !this.threeJsContext.camera) {
				console.error("Invalid Three.js context");
				return { success: false, error: "Invalid Three.js context" };
			}

			if (e === null || e === undefined) {
				console.error("Invalid angle parameters");
				return { success: false, error: "Invalid angle parameters" };
			}

			// Parse and validate angles
			const degX = parseFloat(e.x);
			const degY = parseFloat(e.y);
			const degZ = parseFloat(e.z);

			if (isNaN(degX) || isNaN(degY) || isNaN(degZ)) {
				console.error("Invalid angle values:", { x: e.x, y: e.y, z: e.z });
				return { success: false, error: "Invalid angle values" };
			}

			// Convert degrees to radians
			const radX = THREE.MathUtils.degToRad(degX);
			const radY = THREE.MathUtils.degToRad(degY);
			const radZ = THREE.MathUtils.degToRad(degZ);

			try {
				this.threeJsContext.camera.rotation.set(radX, radY, radZ);

				

				//console.log("Camera angle (rotation) set to:", { x: degX, y: degY, z: degZ });
				return { success: true, rotation: { x: degX, y: degY, z: degZ } };

			} catch (error) {
				console.error("Error setting camera angle:", error);
				return { success: false, error: error.message };
			}
		}
