	// --- New shape helpers ---
	_createIcosahedron(color, materialType, props) {
		const geometry = new THREE.IcosahedronGeometry(
			props.radius ?? 1,
			props.detail ?? 0
		);
		const material = this._createMaterial(materialType, color, props);
		return new THREE.Mesh(geometry, material);
	}
	_createTorus(color, materialType, props) {
		const geometry = new THREE.TorusGeometry(
			props.radius ?? 1,
			props.tube ?? 0.4,
			props.radialSegments ?? 8,
			props.tubularSegments ?? 6
		);
		const material = this._createMaterial(materialType, color, props);
		return new THREE.Mesh(geometry, material);
	}
	_createTorusKnot(color, materialType, props) {
		const geometry = new THREE.TorusKnotGeometry(
			props.radius ?? 1,
			props.tube ?? 0.4,
			props.tubularSegments ?? 64,
			props.radialSegments ?? 8,
			props.p ?? 2,
			props.q ?? 3
		);
		const material = this._createMaterial(materialType, color, props);
		return new THREE.Mesh(geometry, material);
	}
	_createCone(color, materialType, props) {
		const geometry = new THREE.ConeGeometry(
			props.radius ?? 1,
			props.height ?? 2,
			props.radialSegments ?? 8,
			props.heightSegments ?? 1
		);
		const material = this._createMaterial(materialType, color, props);
		return new THREE.Mesh(geometry, material);
	}
	_createCapsule(color, materialType, props) {
		const geometry = new THREE.CapsuleGeometry(
			props.radius ?? 1,
			props.length ?? 2,
			props.capSegments ?? 4,
			props.radialSegments ?? 8
		);
		const material = this._createMaterial(materialType, color, props);
		return new THREE.Mesh(geometry, material);
	}
	_createRing(color, materialType, props) {
		const geometry = new THREE.RingGeometry(
			props.innerRadius ?? 0.5,
			props.outerRadius ?? 1,
			props.thetaSegments ?? 8,
			props.phiSegments ?? 1,
			props.thetaStart ?? 0,
			props.thetaLength ?? Math.PI * 2
		);
		const material = this._createMaterial(materialType, color, props);
		return new THREE.Mesh(geometry, material);
	}
