	_createMaterial(materialType, color, props) {
		// Default color fallback
		let colorValue = 0x00ff00;
		let opacity = props.opacity ?? 1.0;
		let transparent = props.transparent ?? false;

		// Handle color input
		let threeColor;

		if (typeof color === 'number') {
			// Convert to unsigned 32-bit integer to handle negative values correctly
			const unsignedColor = color >>> 0;

			// Check if it's a 32-bit RGBA value or 24-bit RGB
			if (unsignedColor > 0xFFFFFF) {
				// 32-bit RGBA format (0xRRGGBBAA)
				const r = (unsignedColor >>> 24) & 0xff;
				const g = (unsignedColor >>> 16) & 0xff;
				const b = (unsignedColor >>> 8) & 0xff;
				const a = unsignedColor & 0xff;

				threeColor = new THREE.Color(`rgb(${r},${g},${b})`);
				colorValue = (r << 16) | (g << 8) | b;
				opacity = a / 255;
				transparent = opacity < 1.0;

				console.log('32-bit RGBA parsed:', { originalColor: color, unsignedColor, r, g, b, a, opacity });
			} else {
				// 24-bit RGB format (0xRRGGBB)
				const r = (unsignedColor >>> 16) & 0xff;
				const g = (unsignedColor >>> 8) & 0xff;
				const b = unsignedColor & 0xff;

				threeColor = new THREE.Color(`rgb(${r},${g},${b})`);
				colorValue = (r << 16) | (g << 8) | b;
				// Keep the original opacity from props for RGB
				opacity = props.opacity ?? 1.0;
				transparent = props.transparent ?? false;

				//console.log('24-bit RGB parsed:', { originalColor: color, unsignedColor, r, g, b });
			}
		}
		else if (typeof color === 'string' && color.startsWith('rgba')) {
			const matches = color.match(/rgba?\((\d+),\s*(\d+),\s*(\d+),?\s*([\d\.]+)?\)/);
			if (matches) {
				const [, r, g, b, a] = matches;
				threeColor = new THREE.Color(`rgb(${r},${g},${b})`);
				colorValue = (parseInt(r) << 16) | (parseInt(g) << 8) | parseInt(b);
				opacity = a !== undefined ? parseFloat(a) : 1.0;
				transparent = opacity < 1.0;

				//console.log('RGBA string parsed:', { r, g, b, a, opacity });
			} else {
				// Fallback if regex fails
				threeColor = new THREE.Color(0x00ff00);
				colorValue = 0x00ff00;
			}
		}
		else if (typeof color === 'string' && color.startsWith('rgb')) {
			const matches = color.match(/rgb\((\d+),\s*(\d+),\s*(\d+)\)/);
			if (matches) {
				const [, r, g, b] = matches;
				threeColor = new THREE.Color(`rgb(${r},${g},${b})`);
				colorValue = (parseInt(r) << 16) | (parseInt(g) << 8) | parseInt(b);
				// Keep the original opacity from props for RGB strings
				opacity = props.opacity ?? 1.0;
				transparent = props.transparent ?? false;

				//console.log('RGB string parsed:', { r, g, b });
			} else {
				// Let THREE.Color handle it directly
				threeColor = new THREE.Color(color);
				colorValue = threeColor.getHex();
				opacity = props.opacity ?? 1.0;
				transparent = props.transparent ?? false;
			}
		}
		else if (typeof color === 'string') {
			threeColor = new THREE.Color(color);
			colorValue = threeColor.getHex();
			// Keep the original opacity from props for hex/named colors
			opacity = props.opacity ?? 1.0;
			transparent = props.transparent ?? false;
		}
		else {
			threeColor = new THREE.Color(colorValue);
		}

		const materialProps = {
			color: threeColor,
			transparent: transparent,
			opacity: opacity,
			wireframe: props.wireframe || false
		};

		// Extra PBR properties for standard/physical materials
		if (materialType.toLowerCase() === 'standard') {
			materialProps.metalness = props.metalness ?? 0.0;
			materialProps.roughness = props.roughness ?? 1.0;
		}

		// Debug info
		const rgb = {
			r: Math.round(threeColor.r * 255),
			g: Math.round(threeColor.g * 255),
			b: Math.round(threeColor.b * 255)
		};

		// console.log("Creating material with color:", {
		// 	hex: "0x" + colorValue.toString(16).padStart(6, '0'),
		// 	rgb: rgb,
		// 	originalColor: color,
		// 	opacity: opacity,
		// 	transparent: transparent,
		// 	materialType: materialType
		// });

		switch (materialType.toLowerCase()) {
			case 'basic':
				return new THREE.MeshBasicMaterial(materialProps);
			case 'lambert':
				return new THREE.MeshLambertMaterial(materialProps);
			case 'phong':
				return new THREE.MeshPhongMaterial(materialProps);
			case 'standard':
			default:
				return new THREE.MeshStandardMaterial(materialProps);
		}
	}

	drawLine(context, e) {
		const {
			startPos,
			endPos,
			isDashed,
			color,
			name = null,
			lineWidth = 10,
			objectId,
			points
		} = e;

		if (!context?.scene) {
			console.error("Three.js scene not available");
			return null;
		}

		// Convert hex color string to integer if needed
		let lineColor = color;
		if (typeof lineColor === 'string') {
			lineColor = parseInt(lineColor.replace('#', '0x'));
		}

		// Default points to start/end if none provided
		let usedPoints;
		if (!points || points.length === 0) {
			usedPoints = [
				new THREE.Vector3(startPos.x, startPos.y, startPos.z),
				new THREE.Vector3(endPos.x, endPos.y, endPos.z)
			];
		} else if (typeof points === 'string') {
			try {
				const parsed = JSON.parse(points);
				usedPoints = parsed.map(p => new THREE.Vector3(p.x, p.y, p.z));
			} catch (err) {
				console.warn("Invalid points string:", err);
				usedPoints = [
					new THREE.Vector3(startPos.x, startPos.y, startPos.z),
					new THREE.Vector3(endPos.x, endPos.y, endPos.z)
				];
			}
		} else {
			// Assume it's already an array of objects
			usedPoints = points.map(p => new THREE.Vector3(p.x, p.y, p.z));
		}

		if (context.objects.has(objectId)) {
			// Update existing line
			const line = context.objects.get(objectId);
			const geom = line.geometry;
			const positionAttr = geom.attributes.position;

			// If points length changed, recreate geometry
			if (positionAttr.count !== usedPoints.length) {
				geom.dispose();
				line.geometry = new THREE.BufferGeometry().setFromPoints(usedPoints);
			} else {
				// Update existing position buffer
				for (let i = 0; i < usedPoints.length; i++) {
					positionAttr.setXYZ(i, usedPoints[i].x, usedPoints[i].y, usedPoints[i].z);
				}
				positionAttr.needsUpdate = true;
			}

			// Update dashed distances if needed
			if (isDashed && line.computeLineDistances) {
				line.computeLineDistances();
			}

			// Update material color if changed
			if (line.material.color.getHex() !== lineColor) {
				line.material.color.setHex(lineColor);
			}
			// Update linewidth
			line.material.linewidth = lineWidth;

			// Update name if provided
			if (name) {
				line.name = name;
			}

			return line;
		}

		// Create new line geometry & material
		const geometry = new THREE.BufferGeometry().setFromPoints(usedPoints);

		let material;
		let line;
		if (isDashed) {
			material = new THREE.LineDashedMaterial({
				color: lineColor,
				linewidth: lineWidth,
				scale: 1,
				dashSize: 0.1,
				gapSize: 0.1,
			});
			line = new THREE.Line(geometry, material);
			line.computeLineDistances();
		} else {
			material = new THREE.LineBasicMaterial({
				color: lineColor,
				linewidth: lineWidth
			});
			line = new THREE.Line(geometry, material);
		}

		if (name) {
			line.name = name;
		}

		line.userData.ignoreRaycast = true;

		// Add line to scene and cache
		context.scene.add(line);
		context.objects.set(objectId,  line );

		return line;
	}



