	// Method to update light properties
	updateLightProperties(context, objectId, properties) {
		if (!context || !objectId) {
			return { success: false, error: "Invalid context or object ID" };
		}

		const lightData = context.objects.get(objectId);
		if (!lightData || !lightData.object) {
			return { success: false, error: "Light not found" };
		}

		const light = lightData;

		try {
			if (properties.color !== undefined) {
				light.color.set(properties.color);
			}
			if (properties.intensity !== undefined) {
				light.intensity = properties.intensity;
			}
			if (properties.position) {
				light.position.set(
					properties.position.x ?? light.position.x,
					properties.position.y ?? light.position.y,
					properties.position.z ?? light.position.z
				);
			}
			if (properties.target && light.target) {
				light.target.position.set(
					properties.target.x ?? light.target.position.x,
					properties.target.y ?? light.target.position.y,
					properties.target.z ?? light.target.position.z
				);
			}
			if (properties.castShadow !== undefined) {
				light.castShadow = properties.castShadow;
			}
			if (properties.distance !== undefined && light.distance !== undefined) {
				light.distance = properties.distance;
			}
			if (properties.angle !== undefined && light.angle !== undefined) {
				light.angle = properties.angle;
			}
			if (properties.penumbra !== undefined && light.penumbra !== undefined) {
				light.penumbra = properties.penumbra;
			}
			if (properties.decay !== undefined && light.decay !== undefined) {
				light.decay = properties.decay;
			}

			// Update helper if it exists
			this.updateLightHelper(context, objectId);

			return { success: true };
		} catch (error) {
			console.error("Failed to update light properties:", error);
			return { success: false, error: error.message };
		}
	}

	updateLightHelper(context, lightId) {
		const helperId = `${lightId}_helper`;
		const helperData = context.objects.get(helperId);

		if (helperData) {
			try {
				// Update the helper
				if (helperData.update) {
					helperData.update();
				}
				return { success: true };
			} catch (error) {
				console.error(`Error updating light helper ${helperId}:`, error);
				return { success: false, error: error.message };
			}
		}

		return { success: true }; // No helper to update
	}

	// Add this method to ThreeJsManager
	applyMaterialToObject(object, config) {
		// Remove old material if needed
		console.log("Applying material with properties:", config);
		if (object.material) {
			if (Array.isArray(object.material)) {
				object.material.forEach(mat => mat.dispose());
			} else {
				object.material.dispose();
			}
		}
		// Prepare material properties
		const matProps = {
			color: config.color !== undefined ? config.color : 0xffffff,
			wireframe: !!config.wireframe,
			opacity: config.opacity !== undefined ? config.opacity : 1.0,
			transparent: config.opacity !== undefined && config.opacity < 1.0,
			metalness: config.metalness,
			roughness: config.roughness,
			shininess: config.shininess,
			emissive: config.emissive,
			emissiveIntensity: config.emissiveIntensity||1,
			toneMapped : config.emissiveIntensity>1,
			specular: config.specular
		};
		console.log("Applying material with properties:", matProps);
		// Remove undefined properties (Three.js throws on undefined)
		Object.keys(matProps).forEach(key => matProps[key] === undefined && delete matProps[key]);
		// Create material
		let material;
		switch ((config.materialType || config.material || "standard").toLowerCase()) {
			case "phong":
				material = new THREE.MeshPhongMaterial(matProps);
				break;
			case "lambert":
				material = new THREE.MeshLambertMaterial(matProps);
				break;
			case "basic":
				material = new THREE.MeshBasicMaterial(matProps);
				break;
			case "standard":
			default:
				material = new THREE.MeshStandardMaterial(matProps);
				break;
		}
		object.material = material;
		return material;
	}
	
	
