class PixelatedEdgePass {
    constructor(resolution) {
        this.resolution = resolution;
        
        const shader = {
            uniforms: {
                tDiffuse: { value: null },
                resolution: {
                    value: new THREE.Vector4(
                        resolution.x,
                        resolution.y,
                        1 / resolution.x,
                        1 / resolution.y
                    )
                },
                pixelSize: { value: 4.0 }
            },
            vertexShader: `
                varying vec2 vUv;
                
                void main() {
                    vUv = uv;
                    gl_Position = projectionMatrix * modelViewMatrix * vec4(position, 1.0);
                }
            `,
            fragmentShader: `
                uniform sampler2D tDiffuse;
                uniform vec4 resolution;
                uniform float pixelSize;
                varying vec2 vUv;

                vec2 pixelate(vec2 uv) {
                    vec2 pixels = resolution.xy / pixelSize;
                    return floor(uv * pixels) / pixels;
                }

                float luminance(vec3 color) {
                    return dot(color, vec3(0.299, 0.587, 0.114));
                }

                float edgeDetection(vec2 uv) {
                    vec2 texelSize = vec2(1.0 / resolution.x, 1.0 / resolution.y) * pixelSize;
                    
                    float center = luminance(texture2D(tDiffuse, uv).rgb);
                    float left = luminance(texture2D(tDiffuse, uv - vec2(texelSize.x, 0.0)).rgb);
                    float right = luminance(texture2D(tDiffuse, uv + vec2(texelSize.x, 0.0)).rgb);
                    float top = luminance(texture2D(tDiffuse, uv - vec2(0.0, texelSize.y)).rgb);
                    float bottom = luminance(texture2D(tDiffuse, uv + vec2(0.0, texelSize.y)).rgb);
                    
                    float sobelX = (-1.0 * left) + (1.0 * right);
                    float sobelY = (-1.0 * top) + (1.0 * bottom);
                    
                    return sqrt(sobelX * sobelX + sobelY * sobelY);
                }

                void main() {
                    vec2 pixelatedUV = pixelate(vUv);
                    vec4 texel = texture2D(tDiffuse, pixelatedUV);
                    
                    float edge = edgeDetection(pixelatedUV);
                    float edgeThreshold = 0.1;
                    float edgeStrength = 0.8;
                    
                    float coefficient = edge > edgeThreshold ? 
                        (1.0 - edgeStrength * edge) : 1.0;
                    
                    gl_FragColor = texel * coefficient;
                }
            `
        };

        this.material = new THREE.ShaderMaterial(shader);
        this.uniforms = this.material.uniforms;
        this.fsQuad = new THREE.FullScreenQuad(this.material);
        this.enabled = true;
        this.needsSwap = true;
        this.clear = false;
        this.renderToScreen = false;
    }

    render(renderer, writeBuffer, readBuffer) {
        this.uniforms.tDiffuse.value = readBuffer.texture;
        
        if (this.renderToScreen) {
            renderer.setRenderTarget(null);
        } else {
            renderer.setRenderTarget(writeBuffer);
            if (this.clear) renderer.clear();
        }
        
        this.fsQuad.render(renderer);
    }

    setSize(width, height) {
        this.resolution.set(width, height);
        this.uniforms.resolution.value.set(
            width, height, 1/width, 1/height
        );
    }

    dispose() {
        this.material.dispose();
        this.fsQuad.dispose();
    }
}
